<br><br><span class="GText2" style="
color: #00ff00;
">// index.php (Programme principal)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
