">// app/cEnvo.php (Chargement des variables d'environnement)</span><br><pre class="GCode1 Code1 AceCode" data-mode="php" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
&lt;?php

namespace app;

class cEnvo
{
    private static $m_instance = null;
    public $m_aEnvType;

    private function __construct() {}

    public static function Instance()
    {
        if (is_null(self::$m_instance)) {
            self::$m_instance = new cEnvo();
            self::$m_instance-&gt;init();
        }
        return self::$m_instance;
    }

    private function init()
    {
        $this-&gt;m_aEnvType = $this-&gt;loadEnv("ENV_TYPE");
    }

    private function loadEnv($_aEnv, $aDefaultValue = "")
    {
        $aValue = getenv($_aEnv);
        if (!$aValue) return $aDefaultValue;
        return $aValue;
    }
}
