<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="configurer-le-numero-de-port-du-serveur-config">Configurer le numéro de port du serveur</a>
</h1>
<div class="Section6"><br>Les machines virtuelles sont des gestionnaires de sites web. Elles permettent de gérer plusieurs sites web sur une même machine. Chaque serveur web présent sur la machine est accessible à travers un <b>numéro de port</b> unique.
<br><br><span class="GText2" style="
color: #00ff00;
">// Windows (Configurer le numéro de port du serveur)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le fichier de configuration Apache
C:\wamp64\bin\apache\apache2.4.54.2\conf\httpd.conf  
...
# Configurer le numéro de port
# Ajouter les lignes ci-dessous
Listen 0.0.0.0:8000
Listen [::0]:8000
...</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="configurer-le-repertoire-racine-du-serveur-config">Configurer le répertoire racine du serveur</a>
</h1>
<div class="Section6"><br>Les <b>machines virtuelles</b> sont des gestionnaires de sites web. Elles permettent de gérer plusieurs sites web sur une même machine. Chaque serveur web présent sur la machine est associé à un répertoire racine auquel l'on associe des autorisations afin de rendre certaines parties de son contenu disponibles sur le web.<br><br><span class="GText2" style="
color: #00ff00;
">// Windows (Configurer le répertoire racine du serveur)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le fichier de configuration des machines virtuelles
C:\wamp64\v3.3.0\bin\apache\apache2.4.54.2\conf\extra\httpd-vhosts.conf
...
# Configurer le répertoire racine du serveur
# Ajouter les lignes ci-dessous
...
&lt;VirtualHost *:8000&gt;
    ServerName readyweb.com
    ServerAlias www.readyweb.com 
    ServerAdmin contact@readyweb.com
    DocumentRoot " C:/.../webroot/"

    &lt;Directory "C:/.../webroot/"&gt;
        Options All
        AllowOverride All
        Order allow,deny
        allow from all
        Require all granted
    &lt;/Directory&gt;
&lt;/VirtualHost&gt;
...
# Notre serveur web sera accessible à l'adresse ci-dessous
http://localhost:8000/
...
# Nous laisserons le port 80 par défaut
# Pour la page d'accueil de WampServer
...
&lt;VirtualHost *:80&gt;
    ServerName localhost
    ServerAlias localhost
    DocumentRoot "${INSTALL_DIR}/www"
    
    &lt;Directory "${INSTALL_DIR}/www/"&gt;
        Options +Indexes +Includes +FollowSymLinks +MultiViews
        AllowOverride All
        Require local
    &lt;/Directory&gt;
&lt;/VirtualHost&gt;
...</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="configurer-une-variable-d-environnement-config">Configurer une variable d'environnement</a>
</h1>
<div class="Section6"><br>Une <b>variable d'environnement</b> est un moyen de faire passer des paramètres à un serveur web à partir de l'extérieur. Elle peut être exploitée pour changer dynamiquement le comportement du serveur web. L'instruction <b>SetEnv </b>permet de configurer une variable d'environnement pour un serveur Apache.<br><br><span class="GText2" style="
color: #00ff00;
">// Windows (Configurer une variable d'environnement)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Ouvrir le fichier de configuration des machines virtuelles
C:\wamp64\v3.3.0\bin\apache\apache2.4.54.2\conf\extra\httpd-vhosts.conf
...
# Configurer la variable d'environnement
# Ajouter les lignes ci-dessous
...
&lt;VirtualHost *:8000&gt;
    ServerName readyweb.com
    ServerAlias www.readyweb.com 
    ServerAdmin contact@readyweb.com
    DocumentRoot " C:/.../webroot/"

    SetEnv ENV_TYPE "TEST"

    &lt;Directory "C:/.../webroot/"&gt;
        Options All
        AllowOverride All
        Order allow,deny
        allow from all
        Require all granted
    &lt;/Directory&gt;
&lt;/VirtualHost&gt;
...</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="afficher-le-contenu-d-une-page-web-config">Afficher le contenu d'une page web</a>
</h1>
<div class="Section6"><br>L'<b>affichage du contenu</b> d'une page web permet de visualiser le rendu final du code dans le navigateur et de déceler d'éventuels problèmes de syntaxe.<br><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Afficher le contenu d'une page web)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Methode 1
# Afficher le contenu de la page web
[page-web] &gt; Clic droit &gt; Afficher le code source de la page
...
# Methode 2
# Afficher le contenu de la page web
[page-web] &gt; Touche (Ctrl + U)
...</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="ouvrir-les-outils-de-developpement-config">Ouvrir les outils de développement</a>
</h1>
<div class="Section6"><br>Les <b>outils de développement</b> fournissent l'ensemble des fonctionnalités nécessaires au débogage de la page web.<br><br><span class="GText2" style="
color: #00ff00;
">// Google Chrome (Ouvrir les outils de développement)</span><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">...
# Méthode 1
# Ouvrir les outils de développement
Paramètres &gt; Plus d'outils &gt; Outils de développement
...
# Méthode 2
# Ouvrir les outils de développement
Touche (Ctrl + MAJ + I)
...</pre><br>La fenêtre (<b>Console</b>) sert à visualiser les messages JavaScript envoyés vers la console à partir de la page web.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>La fenêtre (<b>Eléments</b>) sert visualiser le contenu HTML de la page web.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>La fenêtre (<b>Appareils</b>) sert visualiser le rendu de la page web sur différents types d'appareils mobiles.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
